import React, { useState } from 'react';

const F1Button = ({ children, onClick }) => {
  const [isHover, setHover] = useState(false);

  const buttonStyle = {
    display: 'inline-block',
    backgroundColor: isHover ? '#00cbbd' : '#00f0dc',
    color: '#000',
    fontWeight: 900,
    fontSize: 20,
    padding: '14px 28px',
    textAlign: 'center',
    textTransform: 'uppercase',
    border: 'none',
    cursor: 'pointer',
    position: 'relative',
    margin: '16px auto',
    width: '80%',
    maxWidth: '400px',
    transition: 'all 0.3s ease',
    clipPath: 'polygon(5% 0%, 100% 0%, 100% 85%, 97% 100%, 0% 100%)',
    borderBottomRightRadius: 30,
    boxShadow: '0 4px 15px rgba(0, 0, 0, 0.3)',
    transform: isHover ? 'translateY(-2px)' : 'translateY(0)',
  };

  return (
    <button
      onClick={onClick}
      onMouseEnter={() => setHover(true)}
      onMouseLeave={() => setHover(false)}
      style={buttonStyle}
    >
      {children}
    </button>
  );
};

const App = () => {
  return (
    <div
      style={{
        fontFamily: 'Arial, sans-serif',
        minHeight: '100vh',
        backgroundColor: '#c8c8c8',
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        justifyContent: 'center',
        padding: '40px',
        textAlign: 'center',
      }}
    >
      <img
        src="/Image_1.png"
        alt="NTU F1 Logo"
        style={{
          width: 120,
          height: 120,
          borderRadius: '50%',
          objectFit: 'cover',
          boxShadow: '0 4px 20px rgba(0,0,0,0.3)',
          marginBottom: 20,
        }}
      />
      <h1 style={{ fontSize: 32, marginBottom: 30 }}>NTUF1Links</h1>
      <F1Button>Events</F1Button>
      <F1Button>Instagram</F1Button>
      <F1Button>Become a Member</F1Button>
      <F1Button>TikTok</F1Button>
    </div>
  );
};

export default App;
